        Стадия 1: Продромальная фаза


        Незначительные изменения в поведении, настроении и когнитивных функциях

        Могут возникать смутные чувства тревоги, депрессии или беспокойства

        Трудности с концентрацией внимания, принятием решений или сном


        Стадия 2: Острый психотический эпизод


        Внезапное появление галлюцинаций, бреда или дезорганизованного мышления

        Могут возникать слуховые или зрительные галлюцинации или ощущение, что за ними наблюдают.

        Нарушается речь, поведение или эмоции.


        Стадия 3: Выздоровление.


        Симптомы начинают ослабевать по мере лечения.

        Могут по-прежнему возникать галлюцинации или бред, но реже.

        Постепенно восстанавливаются нормальные когнитивные функции и эмоциональная стабильность


        Стадия 4: Остаточная фаза


        Симптомы в основном уменьшились, но некоторые остаточные явления сохраняются

        Все еще могут наблюдаться легкие галлюцинации, бред или когнитивные нарушения

        Для устранения симптомов необходимо постоянное лечение


        Стадия 5: Рецидив


        Симптомы возвращаются, часто вызванные стрессом, несоблюдением режима приема лекарств или другими факторами

        Могут повторяться острые психотические эпизоды

        Требуется немедленное лечение для предотвращения дальнейшего ухудшения состояния

