- proto: PaperCaptainsThoughts
  entities:
  - uid: 17121
    components:
    - type: Transform
      rot: -1.5707963267948966 rad
      pos: 146.41447,-1.0549958
      parent: 2
    - type: Paper
      content: >+
        Капитан Арин Вексар, опытный космический путешественник, стоял, выпрямившись, на мостике станции "Forntier". Его пронзительные голубые глаза осматривали горизонт, а разум был сосредоточен на предстоящей миссии. Но его размышления были прерваны появлением его возлюбленной, Лиры, потрясающей красавицы с пронзительными зелеными глазами и волосами цвета воронова крыла.


        Лира, опытный оперативник, была послана внедриться в командование "Frontier" под видом дипломатического посланника. Капитан Вексар не знал, что она была двойным агентом, работавшим на конкурирующую группировку с миссией по его устранению. Ее истинные намерения были скрыты за маской очарования и привязанности, которые покорили сердце капитана.


        Шли дни, миссия Лиры продвигалась, и она собирала информацию о Капитане, ожидая подходящего момента, чтобы нанести удар. Тем временем капитан Вексар влюблялся в нее все больше и больше, не замечая опасности, таящейся за ее очаровательной улыбкой.


        В одну роковую ночь, когда корабль проходил через опасное астероидное поле, Лира сделала свой ход. Она проскользнула в каюту капитана, держа в руке пистолет "Гадюка". Но как только она собралась нажать курок, ее взгляд остановился на голографическом сообщении от ее фракции, раскрывающем истинную суть ее миссии.


        Разрываясь между своим долгом и растущими чувствами к капитану, Лира заколебалась. Капитан Вексар, почувствовав неладное, повернулся к ней лицом. В этот момент он увидел правду в ее глазах – правду о ее миссии и правду о ее противоречивом сердце.


        Капитан Вексар начал действовать без колебаний. Он обезоружил Лиру и прижал ее к стене, его хватка была твердой, но нежной. "Почему, Лира?" спросил он, и в его голосе смешались гнев и печаль.


        Лира со слезами на глазах призналась в своей миссии и в своей истинной преданности. Капитан Вексар, на сердце у которого было тяжело от ее предательства, сделал выбор. Он решил спасти ее, дать ей шанс искупить свою вину.... Но как?

